import { useState } from "react";
import trovoShopLogo from "assets/images/trovo-shop.png";
import pubgShopLogo from "assets/images/pubg-shop.png";
import s from "./index.module.scss";
import { Link } from "react-router-dom";

export const PubgHeader = () => {
  const [menuOpen, setMenuOpen] = useState(false);

  const toggleMenu = () => {
    setMenuOpen(!menuOpen);
  };

  return (
    <header className={s["header"]}>
      <div className={s["header__left-side"]}>
        <img
          className={s["header__trovo-shop-logo"]}
          alt="trovo-logo"
          src={trovoShopLogo}
        />
        <div className={s["header__separator"]}></div>
        <img
          className={s["header__trovo-shop-logo"]}
          alt="trovo-logo"
          src={pubgShopLogo}
        />
      </div>
      <div className={s["header__right-side"]}>
        <button
          className={s["header__hamburger-button"]}
          onClick={toggleMenu}
        ></button>
        <span className={s["header__hamburger-icon"]}>&#9776;</span>
        <nav className={`${s["navbar"]} ${menuOpen ? s["active"] : ""}`}>
          <ul className={s["navbar__list"]}>
            <li className={s["list__item"]}>
              <a>Активация Кода</a>
            </li>
            <Link className={s["list__item"]} to="/other-games">
              <a>Другие игры</a>
            </Link>
            <li className={s["list__item"]}>
              <a>Контакты</a>
            </li>
          </ul>
        </nav>
      </div>
    </header>
  );
};
